const Home = ({ user, ...params }) => {
  let path;
  console.log("params", { params });

  user && user.p_role === 0
    ? (path = "/home/admin")
    : user.role === 2 //user.email
    ? (path = "/home/student")
    : (path = "/home/teacher");
  // return <Redirect to={path} />;
